import Link from "next/link";
const Home = (props) => {
  return (
    <div>
      <h1>next</h1>
      <h2>{props.message}</h2>
      <Link href="/product">
        <a>to product</a>
      </Link>
      <style jsx>
        {`
          h1 {
            color: red;
          }
        `}
      </style>
    </div>
  );
};

export async function getStaticProps(context) {
  const res = await fetch("http://localhost:3000/api/test");
  const data = await res.json();
  console.log(data);
  return {
    props: { message: data.message },
  };
}
export default Home;
